        "privacyTerms": MessageLookupByLibrary.simpleMessage(
            "នៅក្រោមច្បាប់របស់វៀតណាម ព័ត៌មានរបស់អ្នកប្រើប្រាស់ដូចជាឈ្មោះ អាសយដ្ឋានអ៊ីមែល ពាក្យសម្ងាត់ និងថ្ងៃខែឆ្នាំកំណើតអាចត្រូវបានចាត់ថ្នាក់ជា “ព័ត៌មានផ្ទាល់ខ្លួន។\n\n ជាពិសេស,\n (a) តាមក្រឹត្យលេខ 72/2013 ព័ត៌មានផ្ទាល់ខ្លួនត្រូវបានកំណត់ជាព័ត៌មានដែលភ្ជាប់ទៅនឹងការកំណត់អត្តសញ្ញាណ និងព័ត៌មានលម្អិតផ្ទាល់ខ្លួនរបស់បុគ្គល រួមមានឈ្មោះ អាយុ អាស័យដ្ឋាន លេខអត្តសញ្ញាណប័ណ្ណរបស់ប្រជាពលរដ្ឋ លេខទូរស័ព្ទ អាសយដ្ឋានអ៊ីមែល និងព័ត៌មានផ្សេងទៀត ដូចដែលបានកំណត់ដោយច្បាប់\n\n (b) នៅក្រោមសារាចរលេខ 25/2010 ព័ត៌មានផ្ទាល់ខ្លួនមានន័យថាព័ត៌មានគ្រប់គ្រាន់ដើម្បីកំណត់អត្តសញ្ញាណបុគ្គលម្នាក់យ៉ាងជាក់លាក់ ដែលរួមបញ្ចូលយ៉ាងតិចនូវព័ត៌មានលម្អិតដូចខាងក្រោមៈ ឈ្មោះពេញ ថ្ងៃខែឆ្នាំកំណើត មុខរបរ ចំណងជើង អាសយដ្ឋានទំនាក់ទំនង អាសយដ្ឋានអ៊ីមែល លេខទូរស័ព្ទ អត្តសញ្ញាណ លេខកាតនិងលេខលិខិតឆ្លងដែន។ ព័ត៌មាននៃភាពឯកជនផ្ទាល់ខ្លួនរួមមានកំណត់ត្រាសុខភាព កំណត់ត្រាបង់ពន្ធ លេខប័ណ្ណធានារ៉ាប់រងសង្គម លេខប័ណ្ណឥណទាន និងអាថ៌កំបាំងផ្ទាល់ខ្លួនផ្សេងទៀត។\n\n សារាចរលេខ 25 អនុវត្តចំពោះការប្រមូល និងប្រើប្រាស់ព័ត៌មានផ្ទាល់ខ្លួនតាមគេហទំព័រដែលដំណើរការដោយអាជ្ញាធររដ្ឋាភិបាលវៀតណាម។ សារាចរលេខ 25 មិនអាចអនុវត្តដោយផ្ទាល់ចំពោះការប្រមូល និងប្រើប្រាស់ព័ត៌មានផ្ទាល់ខ្លួនដោយគេហទំព័រដែលដំណើរការដោយអង្គភាពមិនមែនរដ្ឋាភិបាលទេ។ ទោះជាយ៉ាងណាក៏ដោយ បទប្បញ្ញត្តិនៃសារាចរលេខ 25 អាចត្រូវបានអនុវត្តដោយការប្រៀបធៀប។ លើសពីនេះទៀត វាទំនងជាថាអង្គភាពមិនមែនរដ្ឋាភិបាលនឹងស្ថិតនៅក្រោមស្តង់ដារដូចគ្នា ឬតឹងរ៉ឹងជាងស្ថាប័នដែលអនុវត្តចំពោះអង្គភាពរដ្ឋាភិបាល។"),
